INSERT INTO `courses` (`id`, `company_id`, `organization_id`, `golongan_id`, `title`, `description`, `image`, `file`, `video`, `link`, `type`, `created_at`, `updated_at`) VALUES
(109, NULL, NULL, 4, 'Oral Communication', 'Oral Communication (Komunikasi Lisan) adalah pertukaran informasi dan gagasan melalui kata yang diucapkan. Dapat dilakukan secara langsung dalam interaksi tatap muka atau melalui perangkat elektronik lain seperti telepon.', 'course_60543e7168894.png', 'files/sUSpAjBdT0.pdf', 'files/w5G6KPIiuG.mp4', 'https://www.youtube.com/watch?v=thbBBzgkP8E', 4, NULL, '2023-04-03 19:31:21'),
(131, 1, NULL, NULL, 'Written Communication', 'Written Communication (Komunikasi Tertulis) adalah proses penyampaian pesan atau pertukaran informasi antara dua orang atau lebih melalui kata-kata tertulis. Biasanya digunakan ketika informasi yang akan dikirimkan panjang dan mencakup beberapa istilah kompleks yang tidak dapat dijelaskan secara lisan.', 'course_609bac2fdfe48.png', 'files/HND95vOPvY.pdf', 'files/video_written_communication.mp4', 'https://www.youtube.com/watch?v=tf94uMEVTSc', 4, NULL, NULL),
(132, 1, NULL, NULL, 'Presentation', 'Kemampuan presentasi adalah skill yang harus dimiliki oleh setiap orang, terutama yang berhubungan dengan dunia bisnis. Presentasi bisnis merupakan bentuk komunikasi yang berorientasi pada proposal, yang disajikan dalam suatu lingkungan bisnis kepada khalayak yang relatif homogen dari berbagai tingkat pengambil keputusan. Presentasi bisnis ini biasanyanya dilakukan untuk memperkenalkan suatu produk, mempromosikan produk, atau mengusulkan dilakukannya pengembangan produk atau bisnis. Karena itulah, dalam suatu presentasi bisnis harus harus ada persiapan yang matang dari presentator', 'course_60ab1995874c8.png', 'files/file_EY3APM7wED.pdf', 'files/course_video_presentation.mp4', 'https://www.youtube.com/watch?v=cUjewztqx14', 4, NULL, NULL),
(133, 1, NULL, NULL, 'Customer Service', 'Customer service (Layanan Pelanggan) adalah aktivitas pelayanan yang ditujukan dalam  rangka memberikan informasi  terhadap pelanggan berkenaan dengan suatu produk baik dalam bentuk barang ataupun jasa. Dalam prosesnya customer Service perlu menerapkan Service Excellence guna memberikan kepuasan dan mempertahankan pelanggan.', 'course_60d007608e74c.png', 'files/file_bzK36pCf08.pdf', 'files/customer_service.mp4', 'https://www.youtube.com/watch?v=YB9c8rVvVLw', 4, NULL, NULL),
(134, 1, NULL, NULL, 'Adaptability', 'Adaptability (Kemampuan beradaptasi) adalah kemampuan untuk secara efektif menavigasi perubahan, ketidakpastian dan kebaruan dengan mengatur dan memonitor kognitif, perilaku dan respon emosional. Hal ini memungkinkan kesiapan dan kemauan yang lebih besar untuk pelatihan dan pengembangan keterampilan, dan memfasilitasi transisi ke perubahan tempat kerja seperti perubahan teknologi, pertumbuhan dan perkembangan berkelanjutan dalam organisasi.', 'course_60dd2138e151e.png', 'files/file_materi-adaptability.pdf', 'files/adaptability.mp4', 'https://www.youtube.com/watch?v=VANh4EU7iKo', 4, NULL, NULL),
(141, 1, NULL, NULL, 'Initiative', 'Initiative Skill (Kemampuan inisiatif) adalah kemampuan untuk melakukan sesuatu atau bekerja tanpa harus diberi tahu terlebih dahulu apa yang harus dilakukan. Seseorang yang mempunyai kemampuan inisiatif merupakan individu yang senantiasa melakukan self-starting atau mandiri dalam memulai, serta cenderung proaktif dalam mengatasi hambatan untuk mencapai suatu tujuan tertentu. Dengan kemampuan ini, seseorang tidak akan pernah berhenti belajar dan terus berusaha untuk mengembangkan dirinya.', 'course_6109f34c1a21f.png', 'files/file_DPocrD8Wrh.pdf', '', 'https://www.youtube.com/watch?v=ZwlrKIxkW3M', 4, NULL, NULL),
(142, NULL, NULL, NULL, '1 Visi', 'Visi merupakan Pandangan terjauh yang dapat kita lihat', 'course_6114b8198a976.png', 'files/file_Corporate-Values-Visi.pdf', 'files/course/video/Materi-Corporate-Value-Visi.mp4', NULL, 3, NULL, NULL),
(143, 1, NULL, NULL, 'Analytical Thinking', 'Analytical Thinking (Pemikiran Analitis) adalah berpikir visual yang memberikan seseorang kemampuan untuk memecahkan masalah dengan cepat dan efektif. Keterampilan analitis mengacu pada kemampuan untuk mengumpulkan dan menganalisis informasi dan membuat keputusan. Pemikir analitis dapat mendeteksi pola di antara kumpulan data yang sering menghasilkan solusi kreatif.', 'course_613587e0c743f.png', 'files/file_RvANIZlMKs.pdf', '', 'https://www.youtube.com/watch?v=1vzdyARaUoI', 4, NULL, NULL),
(146, 3, 33, NULL, 'Apa itu digital marketing?', 'Pengertian digital marketing adalah suatu strategi pemasaran menggunakan media digital dan internet. Apakah Anda pernah melihat suatu brand atau produk perusahaan yang melakukan digital campaign atau kampanye online? Atau mungkin Anda juga pernah melihatnya melalui website dan social media suatu perusahaan?  Belakangan ini semua hal tersebut tentu saja sering Anda lihat. Hal-hal demikian disebut dengan istilah digital marketing.', 'course_digital-marketing.jpg', 'files/file_dummy.pdf', '', 'https://www.youtube.com/watch?v=Ond2HGdrFc4', 1, NULL, NULL),
(147, 1, NULL, NULL, 'Creative Thinking', 'Kreativitas, merupakan pemikiran alternatif di mana seseorang menjauhkan diri dari ide-ide normal yang terbentuk sebelumnya untuk menemukan cara alternatif untuk menyelesaikan suatu masalah. Apabila dikaitkan dengan Organizational Development, kreativitas mempunyai peran sentral untuk mengadakan atau menciptakan sesuatu yang berkaitan dengan daya saing dan keberlangsungan hidup organisasi (competitive power and sustainable organization)', 'course_6163988d2a8e5.png', 'files/file_XIxawRE7Xu.pdf', '', 'https://www.youtube.com/watch?v=SUesz3otnWY', 4, NULL, NULL),
(149, 3, 36, NULL, 'Branding', 'Latihan bank arthaya branding', 'course_61765c28eca01.jpeg', 'files/file_8hiVM5AWFb.pdf', '', 'https://www.youtube.com/watch?v=mQ17Y6w7x8Q', 1, NULL, NULL),
(150, 3, 37, NULL, 'Kebijakan Perusahaan', 'pemahaman tentang Kebijakan Internal Perusahaan', 'course_617664027d0bf.jpeg', 'files/file_wBeRuscUaI.pdf', 'files/course/video/FkKFIzcpOq7glYATmpKT.mp4', NULL, 1, NULL, NULL),
(151, 3, 36, 4, 'Kebijakan Internal', 'Pemahaman Kebijakan Perusahaan', 'course_6176649abfec2.jpeg', 'files/file_R3lxLBC1bh.pdf', 'files/course/video/AsGP8Z9VCDYsorhwpN2V.mp4', NULL, 1, NULL, NULL),
(152, 1, NULL, NULL, 'Interpersonal Skill', 'Interpersonal Skill (Keterampilan Interpersonal), merupakan keterampilan yang digunakan seseorang untuk membangun hubungan dan berinteraksi dengan orang lain', 'course_618102409483d.png', 'files/file_nej5k2jsfe.pdf', '', 'https://www.youtube.com/watch?v=TcevtdGW8fE', 4, NULL, NULL),
