(373, 4, 77, 4, 'Terobosan Penjualan', 'Berisi tentang metode penjualan. Metode penjualan adalah sebuah panduan yang berisi bagaimana cara untuk melakukan tindakan yang tepat dalam tahap-tahap penjualan produk. Metode penjualan ini dilakukan dengan tujuan supaya penjualan berjalan lebih efektif sehingga keuntungan yang diperoleh lebih maksimal', 'course_625e6ff7b410e.jpeg', 'files/file_kQn1ZhwPLU.pdf', '', 'file:///D:/Yusuf%20Hamdani/MAESA%20GROW/Materi/April/H1/TEROBOSAN%20PENJUALAN.pdf', 1, NULL, NULL),
(374, 4, 99, 3, 'Terobosan Penjualan', 'Berisi tentang metode penjualan. Metode penjualan adalah sebuah panduan yang berisi bagaimana cara untuk melakukan tindakan yang tepat dalam tahap-tahap penjualan produk. Metode penjualan ini dilakukan dengan tujuan supaya penjualan berjalan lebih efektif sehingga keuntungan yang diperoleh lebih maksimal', 'course_625e70d82aabc.jpeg', 'files/file_AE4cIOOvT3.pdf', '', 'file:///D:/Yusuf%20Hamdani/MAESA%20GROW/Materi/April/H1/TEROBOSAN%20PENJUALAN.pdf', 1, NULL, NULL),
(375, 4, 117, 4, 'Terobosan Penjualan', 'Bagaimana strategi penjualan yang baik? Strategi penjualan adalah cara dalam memperoleh pendapatan penjualan (sales) yang disusun berdasarkan kekuatan, keunggulan, pengaruh yang dimiliki perusahaan atau sesorang. Selanjutnya diubah kedalam rencana yang bisa dilakukan (actionable plan) untuk mencari konsumen baru ataupun mengembangkan konsumen yang ada', 'course_625f661ee85a8.jpeg', 'files/file_8xGBjBuAIt.pdf', '', 'file:///D:/Yusuf%20Hamdani/MAESA%20GROW/Materi/April/H1/TEROBOSAN%20PENJUALAN.pdf', 1, NULL, NULL),
