INSERT INTO `materi_vhs` (`id`, `name`, `desc`, `type`, `jadwal_id`, `image`, `file`, `video`, `isPreTest`, `created_at`, `updated_at`) VALUES
(7, 'tes materi 1', '<h1>5 Bahaya Penggunaan Media Sosial Yang Harus Diwaspadai</h1><p><br></p><h2><strong>Pendahuluan</strong></h2><p><br></p><p>Media sosial telah menjadi bagian tak terpisahkan dari kehidupan remaja saat ini. Dari Instagram hingga&nbsp;<a href=\"https://www.tiktok.com/id-ID/\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(68, 68, 68); background-color: transparent;\">TikTok</a>, dari Twitter hingga Facebook, remaja menghabiskan waktu berjam-jam setiap harinya untuk mengakses dan berinteraksi di berbagai&nbsp;<a href=\"https://yogabayuap.com/whatsapp-teknologi-dan-sejarah-perkembangannya/\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(68, 68, 68); background-color: transparent;\">platform&nbsp;</a>tersebut. Namun, dibalik manfaatnya, penggunaan juga membawa berbagai bahaya dan risiko yang harus diwaspadai, terutama bagi remaja.</p><p>Dalam artikel ini, kita akan membahas lima bahaya penggunaan media sosial yang harus diwaspadai remaja. Dari keamanan dan privasi hingga kecanduan, dari konten yang tidak sesuai hingga gangguan hubungan dan cyberbullying. Mari kita bahas lebih lanjut mengenai bahaya-bahaya ini dan bagaimana remaja dapat menghindarinya.</p><p>Penggunaan media sosial semakin populer di kalangan remaja, dan dapat memberikan manfaat seperti membantu mereka terhubung dengan teman-teman mereka dan memperluas jaringan sosial mereka. Namun, ada juga beberapa bahaya yang terkait dengan penggunaan media sosial yang harus diwaspadai. Dalam artikel ini, kita akan membahas lima bahaya penggunaan media sosial yang harus diwaspadai remaja.</p><p><br></p><h2><strong>5 Bahaya</strong></h2><h3><br></h3><h3>Keamanan dan privasi</h3><p>Keamanan dan privasi adalah bahaya yang harus diwaspadai remaja saat menggunakan media sosial. Remaja harus memahami bahwa semua informasi yang mereka bagikan di sini dapat diakses oleh orang lain, termasuk orang yang tidak mereka kenal. Hal ini dapat menyebabkan masalah seperti cyberstalking, cyberbullying, atau bahkan penculikan.</p><p>Selain itu, beberapa aplikasi media sosial dapat meminta izin untuk mengakses informasi pribadi seperti kontak, lokasi, dan data pribadi lainnya. Remaja harus selalu mempertimbangkan risiko dan manfaat dari memberikan akses tersebut. Mereka harus selalu mengatur privasi akun mereka dan membatasi informasi yang mereka bagikan secara publik.</p><h3>Kecanduan</h3><p>Kecanduan adalah bahaya serius dari penggunaan media sosial, terutama bagi remaja. Remaja yang menghabiskan terlalu banyak waktu di media sosial dapat mengalami kesulitan dalam mengatur waktu mereka dan melakukan tugas-tugas penting, seperti belajar atau menyelesaikan pekerjaan rumah. Kecanduan ini juga dapat memengaruhi kesehatan mental dan fisik, karena remaja cenderung kurang tidur, kurang aktif fisik, dan kurang sosialisasi di dunia nyata.</p><h3>Konten yang tidak sesuai</h3><p>Media sosial memungkinkan siapa saja untuk memposting konten apa saja, termasuk konten yang tidak sesuai untuk anak-anak dan remaja. Remaja dapat terpapar pada konten kekerasan, pornografi, atau bahkan pesan yang merugikan. Remaja harus selalu berhati-hati dan waspada tentang jenis konten yang mereka konsumsi di media sosial.</p><h3>Gangguan hubungan</h3><p>Penggunaan media sosial dapat memengaruhi hubungan antara remaja dengan keluarga dan teman-teman mereka. Remaja dapat menghabiskan terlalu banyak waktu di media sosial dan kurang menghabiskan waktu bersama keluarga dan teman-teman mereka di dunia nyata. Hal ini dapat menyebabkan kecemasan dan kesepian, karena remaja tidak merasa terhubung dengan orang-orang di sekitar mereka secara emosional.</p><h3>Cyberbullying</h3><p>Cyberbullying adalah masalah serius yang terkait dengan penggunaan media sosial, terutama bagi remaja. Remaja dapat menjadi sasaran dari cyberbullying, yang dapat menyebabkan kecemasan, depresi, dan bahkan bunuh diri. ini juga dapat terlibat dalam cyberbullying, yang dapat menyebabkan masalah hukum dan moral. Remaja harus selalu berhati-hati dan waspada tentang perilaku mereka di platform digital dan selalu melaporkan perilaku yang merugikan kepada pihak yang berwenang.</p><p>Cyberbullying adalah tindakan menghina, mengejek, atau mempermalukan seseorang secara online atau melalui platform media sosial. Ini dapat terjadi dalam bentuk komentar yang merendahkan, pesan pribadi yang menakutkan atau melecehkan, atau bahkan membuat akun palsu untuk memfitnah atau mempermalukan seseorang. Karena tindakan cyberbullying terjadi di dunia maya, pelaku dapat menyembunyikan identitas mereka dan menyerang seseorang secara anonim.</p><p>Remaja sering menjadi korban cyberbullying karena mereka lebih rentan terhadap tekanan sosial dan sering menggunakan nya untuk berinteraksi dengan teman-teman mereka. Cyberbullying dapat menyebabkan dampak yang signifikan pada kesehatan mental dan fisik remaja. Remaja yang menjadi korban cyberbullying dapat merasa malu, kehilangan rasa percaya diri, dan bahkan mengalami depresi dan kecemasan. Dalam kasus yang paling parah, cyberbullying dapat menyebabkan remaja merasa tidak aman dan bahkan berpikir untuk melakukan tindakan bunuh diri.</p><p>Namun, remaja juga dapat terlibat dalam cyberbullying sebagai pelaku. Mereka mungkin menghina atau mengejek teman mereka secara online tanpa menyadari bahwa tindakan mereka memiliki konsekuensi yang serius. Keterlibatan dalam cyberbullying dapat menyebabkan remaja merasa bersalah dan bahkan dapat berdampak pada masa depan mereka dalam hal keterampilan interpersonal dan kesempatan pekerjaan.</p><p><br></p><h2><strong>Kesimpulan</strong></h2><p>Remaja harus selalu berhati-hati dan waspada tentang perilaku mereka di dunia digital. Mereka harus menghindari tindakan yang merendahkan atau melecehkan orang lain, dan selalu memperlakukan orang lain dengan hormat. Jika mereka menjadi korban cyberbullying, mereka harus segera melaporkannya kepada pihak yang berwenang atau orang dewasa yang dapat membantu mereka mengatasi masalah tersebut. Dalam hal ini, remaja harus mengingat bahwa mereka tidak sendirian dan bahwa ada bantuan tersedia untuk mereka.</p>', '1VHS Basic', 15, 'download_1677468025.png', 'vaksin_1663571146ds_1677468025.pdf', 'error', '1', '2023-02-26 20:20:25', '2023-02-26 20:20:25'),
(8, 'tes 2', '<h1>5 Bahaya Penggunaan Media Sosial Yang Harus Diwaspadai</h1><h2><strong>Pendahuluan</strong></h2><p>Media sosial telah menjadi bagian tak terpisahkan dari kehidupan remaja saat ini. Dari Instagram hingga&nbsp;<a href=\"https://www.tiktok.com/id-ID/\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(68, 68, 68); background-color: transparent;\">TikTok</a>, dari Twitter hingga Facebook, remaja menghabiskan waktu berjam-jam setiap harinya untuk mengakses dan berinteraksi di berbagai&nbsp;<a href=\"https://yogabayuap.com/whatsapp-teknologi-dan-sejarah-perkembangannya/\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(68, 68, 68); background-color: transparent;\">platform&nbsp;</a>tersebut. Namun, dibalik manfaatnya, penggunaan juga membawa berbagai bahaya dan risiko yang harus diwaspadai, terutama bagi remaja.</p><p>Dalam artikel ini, kita akan membahas lima bahaya penggunaan media sosial yang harus diwaspadai remaja. Dari keamanan dan privasi hingga kecanduan, dari konten yang tidak sesuai hingga gangguan hubungan dan cyberbullying. Mari kita bahas lebih lanjut mengenai bahaya-bahaya ini dan bagaimana remaja dapat menghindarinya.</p><p>Penggunaan media sosial semakin populer di kalangan remaja, dan dapat memberikan manfaat seperti membantu mereka terhubung dengan teman-teman mereka dan memperluas jaringan sosial mereka. Namun, ada juga beberapa bahaya yang terkait dengan penggunaan media sosial yang harus diwaspadai. Dalam artikel ini, kita akan membahas lima bahaya penggunaan media sosial yang harus diwaspadai remaja.</p><h2><strong>5 Bahaya</strong></h2><h3>Keamanan dan privasi</h3><p>Keamanan dan privasi adalah bahaya yang harus diwaspadai remaja saat menggunakan media sosial. Remaja harus memahami bahwa semua informasi yang mereka bagikan di sini dapat diakses oleh orang lain, termasuk orang yang tidak mereka kenal. Hal ini dapat menyebabkan masalah seperti cyberstalking, cyberbullying, atau bahkan penculikan.</p><p>Selain itu, beberapa aplikasi media sosial dapat meminta izin untuk mengakses informasi pribadi seperti kontak, lokasi, dan data pribadi lainnya. Remaja harus selalu mempertimbangkan risiko dan manfaat dari memberikan akses tersebut. Mereka harus selalu mengatur privasi akun mereka dan membatasi informasi yang mereka bagikan secara publik.</p><h3>Kecanduan</h3><p>Kecanduan adalah bahaya serius dari penggunaan media sosial, terutama bagi remaja. Remaja yang menghabiskan terlalu banyak waktu di media sosial dapat mengalami kesulitan dalam mengatur waktu mereka dan melakukan tugas-tugas penting, seperti belajar atau menyelesaikan pekerjaan rumah. Kecanduan ini juga dapat memengaruhi kesehatan mental dan fisik, karena remaja cenderung kurang tidur, kurang aktif fisik, dan kurang sosialisasi di dunia nyata.</p><h3>Konten yang tidak sesuai</h3><p>Media sosial memungkinkan siapa saja untuk memposting konten apa saja, termasuk konten yang tidak sesuai untuk anak-anak dan remaja. Remaja dapat terpapar pada konten kekerasan, pornografi, atau bahkan pesan yang merugikan. Remaja harus selalu berhati-hati dan waspada tentang jenis konten yang mereka konsumsi di media sosial.</p><h3>Gangguan hubungan</h3><p>Penggunaan media sosial dapat memengaruhi hubungan antara remaja dengan keluarga dan teman-teman mereka. Remaja dapat menghabiskan terlalu banyak waktu di media sosial dan kurang menghabiskan waktu bersama keluarga dan teman-teman mereka di dunia nyata. Hal ini dapat menyebabkan kecemasan dan kesepian, karena remaja tidak merasa terhubung dengan orang-orang di sekitar mereka secara emosional.</p><h3>Cyberbullying</h3><p>Cyberbullying adalah masalah serius yang terkait dengan penggunaan media sosial, terutama bagi remaja. Remaja dapat menjadi sasaran dari cyberbullying, yang dapat menyebabkan kecemasan, depresi, dan bahkan bunuh diri. ini juga dapat terlibat dalam cyberbullying, yang dapat menyebabkan masalah hukum dan moral. Remaja harus selalu berhati-hati dan waspada tentang perilaku mereka di platform digital dan selalu melaporkan perilaku yang merugikan kepada pihak yang berwenang.</p><p>Cyberbullying adalah tindakan menghina, mengejek, atau mempermalukan seseorang secara online atau melalui platform media sosial. Ini dapat terjadi dalam bentuk komentar yang merendahkan, pesan pribadi yang menakutkan atau melecehkan, atau bahkan membuat akun palsu untuk memfitnah atau mempermalukan seseorang. Karena tindakan cyberbullying terjadi di dunia maya, pelaku dapat menyembunyikan identitas mereka dan menyerang seseorang secara anonim.</p><p>Remaja sering menjadi korban cyberbullying karena mereka lebih rentan terhadap tekanan sosial dan sering menggunakan nya untuk berinteraksi dengan teman-teman mereka. Cyberbullying dapat menyebabkan dampak yang signifikan pada kesehatan mental dan fisik remaja. Remaja yang menjadi korban cyberbullying dapat merasa malu, kehilangan rasa percaya diri, dan bahkan mengalami depresi dan kecemasan. Dalam kasus yang paling parah, cyberbullying dapat menyebabkan remaja merasa tidak aman dan bahkan berpikir untuk melakukan tindakan bunuh diri.</p><p>Namun, remaja juga dapat terlibat dalam cyberbullying sebagai pelaku. Mereka mungkin menghina atau mengejek teman mereka secara online tanpa menyadari bahwa tindakan mereka memiliki konsekuensi yang serius. Keterlibatan dalam cyberbullying dapat menyebabkan remaja merasa bersalah dan bahkan dapat berdampak pada masa depan mereka dalam hal keterampilan interpersonal dan kesempatan pekerjaan.</p><h2><strong>Kesimpulan</strong></h2><p>Remaja harus selalu berhati-hati dan waspada tentang perilaku mereka di dunia digital. Mereka harus menghindari tindakan yang merendahkan atau melecehkan orang lain, dan selalu memperlakukan orang lain dengan hormat. Jika mereka menjadi korban cyberbullying, mereka harus segera melaporkannya kepada pihak yang berwenang atau orang dewasa yang dapat membantu mereka mengatasi masalah tersebut. Dalam hal ini, remaja harus mengingat bahwa mereka tidak sendirian dan bahwa ada bantuan tersedia untuk mereka.</p>', '1VHS Basic', 15, 'code_1677468057.png', 'cv_1663420624_2_1677468057.pdf', 'error', '0', '2023-02-26 20:20:57', '2023-02-26 20:20:57'),
(9, 'tes materi class', '<h1>Flutter: Animated Container Widget</h1><h2><strong>Pendahuluan</strong></h2><p><a href=\"https://yogabayuap.com/flutter-sebuah-framework-yang-layak-kamu-pelajari/\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(68, 68, 68); background-color: transparent;\">Flutter&nbsp;</a>adalah framework open-source yang dikembangkan oleh Google untuk membangun aplikasi mobile dan web yang cantik, responsif, dan cepat. Salah satu fitur menarik di Flutter adalah kemampuan untuk membuat animasi dengan mudah. Dalam artikel ini, kita akan membahas salah satu widget animasi dasar di Flutter yaitu Animated Container.</p><p><a href=\"https://api.flutter.dev/flutter/widgets/AnimatedContainer-class.html\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(68, 68, 68); background-color: transparent;\">AnimatedContainer&nbsp;</a>adalah widget yang mirip dengan Container, namun dengan kemampuan untuk melakukan animasi saat properti tertentu berubah. Dengan AnimatedContainer, Anda dapat membuat animasi untuk perubahan warna, lebar, tinggi, posisi, dan banyak lagi dengan mudah dan cepat. Hal ini sangat membantu dalam meningkatkan interaksi pengguna dan membuat aplikasi terlihat lebih hidup.</p><p>Dalam artikel ini, kita akan membahas bagaimana cara menggunakan AnimatedContainer di Flutter, apa saja properti yang dapat diatur untuk membuat animasi, dan bagaimana cara membuat animasi yang lebih kompleks dengan AnimatedContainer. Mari kita mulai!</p><h2><strong>Penjelasan</strong></h2><h3>Menggunakan AnimatedContainer</h3><p>Pertama-tama, mari kita lihat bagaimana cara menggunakan AnimatedContainer di Flutter. Untuk membuat AnimatedContainer, Anda dapat menggunakan kode berikut:</p><p class=\"ql-align-right\">1</p><p class=\"ql-align-right\">2</p><p class=\"ql-align-right\">3</p><p class=\"ql-align-right\">4</p><p class=\"ql-align-right\">5</p><p class=\"ql-align-right\">6</p><p class=\"ql-align-right\">7</p><p><code style=\"color: rgb(209, 237, 255); background-color: initial;\">AnimatedContainer(</code></p><p><code style=\"color: rgb(209, 237, 255); background-color: initial;\">&nbsp;&nbsp;duration: Duration(milliseconds: 500),</code></p><p><code style=\"color: rgb(209, 237, 255); background-color: initial;\">&nbsp;&nbsp;curve: Curves.easeInOut,</code></p><p><code style=\"color: rgb(209, 237, 255); background-color: initial;\">&nbsp;&nbsp;width: _width,</code></p><p><code style=\"color: rgb(209, 237, 255); background-color: initial;\">&nbsp;&nbsp;height: _height,</code></p><p><code style=\"color: rgb(209, 237, 255); background-color: initial;\">&nbsp;&nbsp;color: _color,</code></p><p><code style=\"color: rgb(209, 237, 255); background-color: initial;\">),</code></p><p>Dalam contoh di atas, kita memberikan durasi animasi sebesar 500 milidetik dan kurva animasi yang akan digunakan adalah easeInOut. Kemudian, kita memberikan nilai untuk lebar, tinggi, dan warna AnimatedContainer.</p><h3>Properti yang dapat diatur</h3><p>Selain properti lebar, tinggi, dan warna, AnimatedContainer juga memiliki properti lain yang dapat diatur untuk membuat animasi. Berikut ini adalah beberapa properti yang dapat diatur:</p><h4><strong>Alignment: posisi container relatif terhadap widget induk</strong></h4><p>AnimatedContainer memiliki properti alignment yang dapat diatur untuk menentukan posisi container relatif terhadap widget induk. Properti ini memiliki tipe AlignmentGeometry yang dapat diisi dengan nilai seperti Alignment.topLeft, Alignment.centerRight, dan sebagainya.</p><p>Berikut adalah contoh penggunaan properti alignment dalam AnimatedContainer:</p><p class=\"ql-align-right\">1</p><p class=\"ql-align-right\">2</p><p class=\"ql-align-right\">3</p><p class=\"ql-align-right\">4</p><p class=\"ql-align-right\">5</p><p class=\"ql-align-right\">6</p><p class=\"ql-align-right\">7</p><p class=\"ql-align-right\">8</p><p><code style=\"color: rgb(209, 237, 255); background-color: initial;\">AnimatedContainer(</code></p><p><code style=\"color: rgb(209, 237, 255); background-color: initial;\">&nbsp;&nbsp;duration: Duration(milliseconds: 500),</code></p><p><code style=\"color: rgb(209, 237, 255); background-color: initial;\">&nbsp;&nbsp;curve: Curves.easeInOut,</code></p><p><code style=\"color: rgb(209, 237, 255); background-color: initial;\">&nbsp;&nbsp;width: _width,</code></p><p><code style=\"color: rgb(209, 237, 255); background-color: initial;\">&nbsp;&nbsp;height: _height,</code></p><p><code style=\"color: rgb(209, 237, 255); background-color: initial;\">&nbsp;&nbsp;color: _color,</code></p><p><code style=\"color: rgb(209, 237, 255); background-color: initial;\">&nbsp;&nbsp;alignment: Alignment.bottomRight,</code></p><p><code style=\"color: rgb(209, 237, 255); background-color: initial;\">),</code></p><p>Dalam contoh di atas, AnimatedContainer akan ditempatkan di pojok kanan bawah dari widget induk. Anda juga dapat menggunakan nilai alignment yang lain sesuai dengan kebutuhan Anda.</p><p>Anda juga dapat menggunakan properti alignment bersama dengan properti padding dan margin untuk menentukan posisi container secara lebih tepat. Misalnya, jika Anda ingin menempatkan AnimatedContainer di tengah-tengah dari widget induk dengan jarak tepi sebesar 16 piksel, Anda dapat menggunakan kode berikut:</p><p class=\"ql-align-right\">1</p><p class=\"ql-align-right\">2</p><p class=\"ql-align-right\">3</p><p class=\"ql-align-right\">4</p><p class=\"ql-align-right\">5</p><p class=\"ql-align-right\">6</p><p class=\"ql-align-right\">7</p><p class=\"ql-align-right\">8</p><p class=\"ql-align-right\">9</p><p><code style=\"color: rgb(209, 237, 255); background-color: initial;\">AnimatedContainer(</code></p><p><code style=\"color: rgb(209, 237, 255); background-color: initial;\">&nbsp;&nbsp;duration: Duration(milliseconds: 500),</code></p><p><code style=\"color: rgb(209, 237, 255); background-color: initial;\">&nbsp;&nbsp;curve: Curves.easeInOut,</code></p><p><code style=\"color: rgb(209, 237, 255); background-color: initial;\">&nbsp;&nbsp;width: _width,</code></p><p><code style=\"color: rgb(209, 237, 255); background-color: initial;\">&nbsp;&nbsp;height: _height,</code></p><p><code style=\"color: rgb(209, 237, 255); background-color: initial;\">&nbsp;&nbsp;color: _color,</code></p><p><code style=\"color: rgb(209, 237, 255); background-color: initial;\">&nbsp;&nbsp;alignment: Alignment.center,</code></p><p><code style=\"color: rgb(209, 237, 255); background-color: initial;\">&nbsp;&nbsp;margin: EdgeInsets.all(16),</code></p><p><code style=\"color: rgb(209, 237, 255); background-color: initial;\">),</code></p><p>Dalam contoh di atas, AnimatedContainer akan ditempatkan di tengah-tengah dari widget induk dengan jarak tepi sebesar 16 piksel di setiap sisi. Properti alignment diatur sebagai Alignment.center, yang menempatkan container di tengah-tengah. Margin diatur sebagai EdgeInsets.all(16), yang memberikan jarak 16 piksel di setiap sisi.</p><h4><strong>Padding dan Margin: jarak antara tepi container dan kontennya</strong></h4><p>AnimatedContainer juga memiliki properti padding yang dapat diatur untuk menentukan jarak antara tepi container dan kontennya. Properti ini memiliki tipe EdgeInsetsGeometry yang dapat diisi dengan nilai seperti EdgeInsets.all, EdgeInsets.only, dan sebagainya.</p><p>Berikut adalah contoh penggunaan properti padding dalam AnimatedContainer:</p><p class=\"ql-align-right\">1</p><p class=\"ql-align-right\">2</p><p class=\"ql-align-right\">3</p><p class=\"ql-align-right\">4</p><p class=\"ql-align-right\">5</p><p class=\"ql-align-right\">6</p><p class=\"ql-align-right\">7</p><p class=\"ql-align-right\">8</p><p><code style=\"color: rgb(209, 237, 255); background-color: initial;\">AnimatedContainer(</code></p><p><code style=\"color: rgb(209, 237, 255); background-color: initial;\">&nbsp;&nbsp;duration: Duration(milliseconds: 500),</code></p><p><code style=\"color: rgb(209, 237, 255); background-color: initial;\">&nbsp;&nbsp;curve: Curves.easeInOut,</code></p><p><code style=\"color: rgb(209, 237, 255); background-color: initial;\">&nbsp;&nbsp;width: _width,</code></p><p><code style=\"color: rgb(209, 237, 255); background-color: initial;\">&nbsp;&nbsp;height: _height,</code></p><p><code style=\"color: rgb(209, 237, 255); background-color: initial;\">&nbsp;&nbsp;color: _color,</code></p><p><code style=\"color: rgb(209, 237, 255); background-color: initial;\">&nbsp;&nbsp;padding: EdgeInsets.all(16),</code></p><p><code style=\"color: rgb(209, 237, 255); background-color: initial;\">),</code></p><p>Dalam contoh di atas, AnimatedContainer akan memiliki jarak tepi sebesar 16 piksel dari kontennya di setiap sisi. Anda juga dapat menggunakan nilai padding yang lain sesuai dengan kebutuhan Anda.</p><p>Anda juga dapat menggunakan properti padding bersama dengan properti alignment dan margin untuk menentukan posisi dan jarak tepat dari container. Misalnya, jika Anda ingin menempatkan konten di tengah-tengah dari AnimatedContainer dengan jarak tepi sebesar 16 piksel, Anda dapat menggunakan kode berikut:</p><p class=\"ql-align-right\">1</p><p class=\"ql-align-right\">2</p><p class=\"ql-align-right\">3</p><p class=\"ql-align-right\">4</p><p class=\"ql-align-right\">5</p><p class=\"ql-align-right\">6</p><p class=\"ql-align-right\">7</p><p class=\"ql-align-right\">8</p><p class=\"ql-align-right\">9</p><p class=\"ql-align-right\">10</p><p class=\"ql-align-right\">11</p><p><code style=\"color: rgb(209, 237, 255); background-color: initial;\">AnimatedContainer(</code></p><p><code style=\"color: rgb(209, 237, 255); background-color: initial;\">&nbsp;&nbsp;duration: Duration(milliseconds: 500),</code></p><p><code style=\"color: rgb(209, 237, 255); background-color: initial;\">&nbsp;&nbsp;curve: Curves.easeInOut,</code></p><p><code style=\"color: rgb(209, 237, 255); background-color: initial;\">&nbsp;&nbsp;width: _width,</code></p><p><code style=\"color: rgb(209, 237, 255); background-color: initial;\">&nbsp;&nbsp;height: _height,</code></p><p><code style=\"color: rgb(209, 237, 255); background-color: initial;\">&nbsp;&nbsp;color: _color,</code></p><p><code style=\"color: rgb(209, 237, 255); background-color: initial;\">&nbsp;&nbsp;alignment: Alignment.center,</code></p><p><code style=\"color: rgb(209, 237, 255); background-color: initial;\">&nbsp;&nbsp;margin: EdgeInsets.all(16),</code></p><p><code style=\"color: rgb(209, 237, 255); background-color: initial;\">&nbsp;&nbsp;padding: EdgeInsets.all(16),</code></p><p><code style=\"color: rgb(209, 237, 255); background-color: initial;\">&nbsp;&nbsp;child: Text(\'Hello World!\'),</code></p><p><code style=\"color: rgb(209, 237, 255); background-color: initial;\">),</code></p><p>Dalam contoh di atas, AnimatedContainer akan ditempatkan di tengah-tengah dari widget induk dengan jarak tepi sebesar 16 piksel di setiap sisi. Alignment diatur sebagai Alignment.center, yang menempatkan container di tengah-tengah. Properti margin diatur sebagai EdgeInsets.all(16), yang memberikan jarak 16 piksel di setiap sisi. Properti padding juga diatur sebagai EdgeInsets.all(16), yang memberikan jarak 16 piksel dari tepi container ke kontennya. Widget Text diisi dengan nilai ‘Hello World!’, dan akan ditempatkan di tengah-tengah dari AnimatedContainer karena properti alignment diatur sebagai Alignment.center.</p><h4><strong>Decoration: dekorasi untuk container seperti border, gambar latar belakang, bayangan, dll.</strong></h4><p>AnimatedContainer memiliki properti decoration yang dapat digunakan untuk mengatur dekorasi pada container seperti background color, gambar background, border, dan sebagainya. Properti decoration memiliki tipe BoxDecoration yang dapat diisi dengan nilai seperti BoxDecoration.color, BoxDecoration.border, dan sebagainya.</p><p>Berikut adalah contoh penggunaan properti decoration dalam AnimatedContainer:</p><p class=\"ql-align-right\">1</p><p class=\"ql-align-right\">2</p><p class=\"ql-align-right\">3</p><p class=\"ql-align-right\">4</p><p class=\"ql-align-right\">5</p><p class=\"ql-align-right\">6</p><p class=\"ql-align-right\">7</p><p class=\"ql-align-right\">8</p><p class=\"ql-align-right\">9</p><p class=\"ql-align-right\">10</p><p class=\"ql-align-right\">11</p><p><code style=\"color: rgb(209, 237, 255); background-color: initial;\">AnimatedContainer(</code></p><p><code style=\"color: rgb(209, 237, 255); background-color: initial;\">&nbsp;&nbsp;duration: Duration(milliseconds: 500),</code></p><p><code style=\"color: rgb(209, 237, 255); background-color: initial;\">&nbsp;&nbsp;curve: Curves.easeInOut,</code></p><p><code style=\"color: rgb(209, 237, 255); background-color: initial;\">&nbsp;&nbsp;width: _width,</code></p><p><code style=\"color: rgb(209, 237, 255); background-color: initial;\">&nbsp;&nbsp;height: _height,</code></p><p><code style=\"color: rgb(209, 237, 255); background-color: initial;\">&nbsp;&nbsp;decoration: BoxDecoration(</code></p><p><code style=\"color: rgb(209, 237, 255); background-color: initial;\">&nbsp;&nbsp;&nbsp;&nbsp;color: Colors.blue,</code></p><p><code style=\"color: rgb(209, 237, 255); background-color: initial;\">&nbsp;&nbsp;&nbsp;&nbsp;borderRadius: BorderRadius.circular(8),</code></p><p><code style=\"color: rgb(209, 237, 255); background-color: initial;\">&nbsp;&nbsp;&nbsp;&nbsp;border: Border.all(color: Colors.black, width: 2),</code></p><p><code style=\"color: rgb(209, 237, 255); background-color: initial;\">&nbsp;&nbsp;),</code></p><p><code style=\"color: rgb(209, 237, 255); background-color: initial;\">),</code></p><p>Dalam contoh di atas, AnimatedContainer akan memiliki background color biru, dengan border berwarna hitam dan lebar 2 piksel, serta borderRadius sebesar 8 piksel. Anda juga dapat menggunakan nilai decoration yang lain sesuai dengan kebutuhan Anda.</p><p>Anda juga dapat menggunakan properti decoration bersama dengan properti alignment, padding, dan margin untuk menentukan posisi, jarak tepi, dan dekorasi dari container. Misalnya, jika Anda ingin membuat AnimatedContainer dengan gambar background, border berwarna kuning, dan ditempatkan di tengah-tengah dari widget induk dengan jarak tepi sebesar 16 piksel, serta jarak antara tepi container dan kontennya sebesar 8 piksel, Anda dapat menggunakan kode berikut:</p><p class=\"ql-align-right\">1</p><p class=\"ql-align-right\">2</p><p class=\"ql-align-right\">3</p><p class=\"ql-align-right\">4</p><p class=\"ql-align-right\">5</p><p class=\"ql-align-right\">6</p><p class=\"ql-align-right\">7</p><p class=\"ql-align-right\">8</p><p class=\"ql-align-right\">9</p><p class=\"ql-align-right\">10</p><p class=\"ql-align-right\">11</p><p class=\"ql-align-right\">12</p><p class=\"ql-align-right\">13</p><p class=\"ql-align-right\">14</p><p class=\"ql-align-right\">15</p><p class=\"ql-align-right\">16</p><p class=\"ql-align-right\">17</p><p><code style=\"color: rgb(209, 237, 255); background-color: initial;\">AnimatedContainer(</code></p><p><code style=\"color: rgb(209, 237, 255); background-color: initial;\">&nbsp;&nbsp;duration: Duration(milliseconds: 500),</code></p><p><code style=\"color: rgb(209, 237, 255); background-color: initial;\">&nbsp;&nbsp;curve: Curves.easeInOut,</code></p><p><code style=\"color: rgb(209, 237, 255); background-color: initial;\">&nbsp;&nbsp;width: _width,</code></p><p><code style=\"color: rgb(209, 237, 255); background-color: initial;\">&nbsp;&nbsp;height: _height,</code></p><p><code style=\"color: rgb(209, 237, 255); background-color: initial;\">&nbsp;&nbsp;alignment: Alignment.center,</code></p><p><code style=\"color: rgb(209, 237, 255); background-color: initial;\">&nbsp;&nbsp;margin: EdgeInsets.all(16),</code></p><p><code style=\"color: rgb(209, 237, 255); background-color: initial;\">&nbsp;&nbsp;padding: EdgeInsets.all(8),</code></p><p><code style=\"color: rgb(209, 237, 255); background-color: initial;\">&nbsp;&nbsp;decoration: BoxDecoration(</code></p><p><code style=\"color: rgb(209, 237, 255); background-color: initial;\">&nbsp;&nbsp;&nbsp;&nbsp;image: DecorationImage(</code></p><p><code style=\"color: rgb(209, 237, 255); background-color: initial;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;image: AssetImage(\'assets/images/background.png\'),</code></p><p><code style=\"color: rgb(209, 237, 255); background-color: initial;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;fit: BoxFit.cover,</code></p><p><code style=\"color: rgb(209, 237, 255); background-color: initial;\">&nbsp;&nbsp;&nbsp;&nbsp;),</code></p><p><code style=\"color: rgb(209, 237, 255); background-color: initial;\">&nbsp;&nbsp;&nbsp;&nbsp;border: Border.all(color: Colors.yellow, width: 4),</code></p><p><code style=\"color: rgb(209, 237, 255); background-color: initial;\">&nbsp;&nbsp;),</code></p><p><code style=\"color: rgb(209, 237, 255); background-color: initial;\">&nbsp;&nbsp;child: Text(\'Hello World!\'),</code></p><p><code style=\"color: rgb(209, 237, 255); background-color: initial;\">),</code></p><p>Dalam contoh di atas, AnimatedContainer akan ditempatkan di tengah-tengah dari widget induk dengan jarak tepi sebesar 16 piksel di setiap sisi. Properti alignment diatur sebagai Alignment.center, yang menempatkan container di tengah-tengah. Properti margin diatur sebagai EdgeInsets.all(16), yang memberikan jarak 16 piksel di setiap sisi. Padding diatur sebagai EdgeInsets.all(8), yang memberikan jarak 8 piksel dari tepi container ke kontennya. Properti decoration diatur sebagai BoxDecoration, yang memiliki background image berupa gambar dengan fit cover dan border berwarna kuning dengan lebar 4 piksel. Widget Text diisi dengan nilai ‘Hello World!’, dan akan ditempatkan di tengah-tengah dari AnimatedContainer karena properti alignment diatur sebagai Alignment.center.</p><p>Anda dapat mengubah nilai properti-properti ini untuk membuat animasi yang lebih menarik.</p><h3>Membuat animasi kompleks</h3><p>Selain mengubah nilai properti, Anda juga dapat membuat animasi yang lebih kompleks dengan AnimatedContainer. Misalnya, Anda dapat membuat animasi ketika pengguna mengetuk widget, atau membuat animasi berulang secara terus-menerus.</p><p>Berikut ini adalah contoh kode untuk membuat animasi ketika pengguna mengetuk AnimatedContainer:</p><p class=\"ql-align-right\">1</p><p class=\"ql-align-right\">2</p><p class=\"ql-align-right\">3</p><p class=\"ql-align-right\">4</p><p class=\"ql-align-right\">5</p><p class=\"ql-align-right\">6</p><p class=\"ql-align-right\">7</p><p class=\"ql-align-right\">8</p><p class=\"ql-align-right\">9</p><p class=\"ql-align-right\">10</p><p class=\"ql-align-right\">11</p><p class=\"ql-align-right\">12</p><p class=\"ql-align-right\">13</p><p class=\"ql-align-right\">14</p><p class=\"ql-align-right\">15</p><p class=\"ql-align-right\">16</p><p class=\"ql-align-right\">17</p><p><code style=\"color: rgb(209, 237, 255); background-color: initial;\">GestureDetector(</code></p><p><code style=\"color: rgb(209, 237, 255); background-color: initial;\">&nbsp;&nbsp;onTap: () {</code></p><p><code style=\"color: rgb(209, 237, 255); background-color: initial;\">&nbsp;&nbsp;&nbsp;&nbsp;setState(() {</code></p><p><code style=\"color: rgb(209, 237, 255); background-color: initial;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;_width = 200;</code></p><p><code style=\"color: rgb(209, 237, 255); background-color: initial;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;_height = 200;</code></p><p><code style=\"color: rgb(209, 237, 255); background-color: initial;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;_color = Colors.blue;</code></p><p><code style=\"color: rgb(209, 237, 255); background-color: initial;\">&nbsp;&nbsp;&nbsp;&nbsp;});</code></p><p><code style=\"color: rgb(209, 237, 255); background-color: initial;\">&nbsp;&nbsp;},</code></p><p><code style=\"color: rgb(209, 237, 255); background-color: initial;\">&nbsp;&nbsp;child: AnimatedContainer(</code></p><p><code style=\"color: rgb(209, 237, 255); background-color: initial;\">&nbsp;&nbsp;&nbsp;&nbsp;duration: Duration(milliseconds: 500),</code></p><p><code style=\"color: rgb(209, 237, 255); background-color: initial;\">&nbsp;&nbsp;&nbsp;&nbsp;curve: Curves.easeInOut,</code></p><p><code style=\"color: rgb(209, 237, 255); background-color: initial;\">&nbsp;&nbsp;&nbsp;&nbsp;width: _width,</code></p><p><code style=\"color: rgb(209, 237, 255); background-color: initial;\">&nbsp;&nbsp;&nbsp;&nbsp;height: _height,</code></p><p><code style=\"color: rgb(209, 237, 255); background-color: initial;\">&nbsp;&nbsp;&nbsp;&nbsp;color: _color,</code></p><p><code style=\"color: rgb(209, 237, 255); background-color: initial;\">&nbsp;&nbsp;),</code></p><p><code style=\"color: rgb(209, 237, 255); background-color: initial;\">),</code></p><p><code style=\"color: rgb(209, 237, 255); background-color: initial;\">﻿</code></p><blockquote>Dalam contoh di atas, kita menggunakan GestureDetector untuk menangkap ketukan pengguna pada AnimatedContainer. Ketika pengguna mengetuk AnimatedContainer, nilai lebar, tinggi, dan warna diubah, dan animasi akan dimulai dengan durasi 500 milidetik dan kurva easeInOut.</blockquote>', '1VHS Class', 16, 'code_1678762208.png', 'vaksin_1663571146ds_1678762208.pdf', 'Getting diamonds in under 2 minutes_1678762208.mp4', '1', '2023-03-13 19:50:16', '2023-03-13 19:50:16'),
(10, 'tes materi class 2', '<h1>WhatsApp: Teknologi dan Sejarah Perkembangannya</h1><h2><strong>Pendahuluan</strong></h2><p>WhatsApp adalah salah satu&nbsp;<a href=\"https://www.whatsapp.com/?lang=id\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(68, 68, 68); background-color: transparent;\">aplikasi pesan instan</a>&nbsp;paling populer di seluruh dunia, dengan lebih dari 2 miliar pengguna aktif bulanan. Aplikasi ini memungkinkan pengguna untuk mengirim pesan teks, suara, gambar, dan video dengan mudah dan cepat, serta melakukan panggilan suara dan video secara gratis.</p><p>Namun, sebelum menjadi aplikasi yang kita kenal dan gunakan sekarang, ada sejarah panjang di balik perkembangannya. Dalam postingan blog ini, kita akan mengeksplorasi sejarah perkembangan dari awal hingga saat ini, serta teknologi apa yang digunakan untuk memungkinkan aplikasi ini menjadi salah satu yang paling&nbsp;<a href=\"https://yogabayuap.com/5-bahasa-pemrograman-terpopuler-2023/\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(68, 68, 68); background-color: transparent;\">populer&nbsp;</a>di dunia.</p><p>Dari awalnya diluncurkan pada tahun 2009 hingga diakuisisi oleh Facebook pada tahun 2014, WhatsApp telah menjadi aplikasi yang sangat populer dan menjadi bagian penting dari kehidupan digital kita. Mari kita lihat lebih dekat bagaimana teknologi dan sejarah perkembangannya membentuk apa yang kita ketahui sebagai WhatsApp hari ini.</p><h2><strong>Sejarah</strong></h2><p>Sejarah WhatsApp dimulai pada tahun 2009 ketika dua mantan karyawan Yahoo!, Brian Acton dan Jan Koum, memulai sebuah aplikasi pesan instan yang awalnya bernama WhatsApp Inc. Aplikasi ini awalnya dirancang untuk membantu pengguna menghindari biaya SMS dengan memanfaatkan koneksi internet untuk mengirim pesan. WhatsApp diluncurkan pada tanggal 24 Februari 2009 untuk iPhone, dan beberapa bulan kemudian juga tersedia untuk pengguna Android.</p><p>Pada awalnya, WhatsApp tidak memiliki banyak pengguna dan membutuhkan beberapa tahun untuk menjadi terkenal. Namun, ketika Apple meluncurkan fitur pesan terenkripsi end-to-end pada tahun 2011, Aplikasi ini menjadi lebih populer karena fitur enkripsi end-to-end sudah ada di aplikasi ini sejak diluncurkan.</p><p>Pada tahun 2014, Facebook mengumumkan bahwa mereka telah mencapai kesepakatan untuk mengakuisisi WhatsApp seharga $ 19 miliar. Akuisisi ini sangat kontroversial dan banyak orang khawatir tentang privasi pengguna setelah WhatsApp diakuisisi oleh Facebook. Namun, pada awalnya, WhatsApp masih beroperasi secara independen dari Facebook.</p><p>Dalam beberapa tahun terakhir, Aplikasi ini telah memperkenalkan banyak fitur baru, termasuk panggilan suara dan video, stiker, dan kemampuan untuk mengirim pesan yang hilang setelah waktu tertentu. WhatsApp juga memperkenalkan fitur WhatsApp Business, yang memungkinkan perusahaan untuk mengirim pesan kepada pelanggan mereka secara langsung melalui aplikasi.</p><p>Hari ini, Aplikasi ini tetap menjadi salah satu aplikasi pesan instan yang paling populer di seluruh dunia, dengan lebih dari 2 miliar pengguna aktif bulanan. Meskipun sejarah perkembangannya tidak selalu lancar, WhatsApp terus berinovasi dan menawarkan fitur baru untuk memenuhi kebutuhan penggunanya.</p><h2><strong>Teknologi</strong></h2><p>Teknologi yang digunakan oleh WhatsApp sangat penting dalam membentuk aplikasi yang kita kenal dan gunakan hari ini. Berikut adalah beberapa teknologi utama yang memungkinkan WhatsApp menjadi salah satu aplikasi pesan instan yang paling populer di dunia:</p><ol><li>Enkripsi End-to-End Enkripsi end-to-end adalah fitur keamanan utama yang digunakan oleh WhatsApp. Fitur ini memastikan bahwa pesan yang dikirim oleh pengguna hanya dapat dibaca oleh penerima dan tidak dapat diakses oleh pihak ketiga atau bahkan oleh Aplikasi itu sendiri. Ini memungkinkan pengguna untuk merasa aman dan terlindungi ketika mengirim pesan melalui aplikasi.</li><li><strong>Koneksi Internet</strong>, memanfaatkan koneksi internet untuk mengirim pesan, yang memungkinkan pengguna untuk menghindari biaya SMS yang mahal. Koneksi internet juga memungkinkan pengguna untuk mengirim pesan dalam jumlah yang lebih besar dan memperkenalkan fitur seperti panggilan suara dan video, yang memungkinkan pengguna untuk berkomunikasi secara lebih efektif.</li><li><strong>Platform Seluler</strong>, tersedia di berbagai platform seluler, termasuk iPhone, Android, dan Windows Phone. Ini memungkinkan pengguna untuk mengirim pesan ke teman dan keluarga mereka, tanpa memandang jenis perangkat yang mereka gunakan.</li><li><strong>Kompresi Data</strong>, menggunakan teknologi kompresi data untuk meminimalkan penggunaan data saat mengirim pesan. Teknologi ini memungkinkan pengguna untuk mengirim pesan dalam jumlah yang lebih besar tanpa khawatir tentang biaya data yang tinggi.</li><li><strong>Cloud Storage</strong>, menggunakan penyimpanan awan untuk menyimpan pesan dan file yang dikirimkan pengguna. Ini memungkinkan pengguna untuk mengakses pesan mereka dari perangkat mana pun, serta memastikan keamanan dan keandalan data.</li></ol><p>Dengan menggunakan teknologi-teknologi ini, WhatsApp telah berhasil menciptakan aplikasi pesan instan yang mudah digunakan, aman, dan efisien. Teknologi-teknologi ini terus ditingkatkan dan dikembangkan oleh WhatsApp, sehingga pengguna selalu mendapatkan pengalaman yang terbaik saat menggunakan aplikasi.</p>', '1VHS Class', 16, 'download_1678762282.png', 'vaksin_1663571146ds_1678762282.pdf', 'error', '0', '2023-03-13 19:51:22', '2023-03-13 19:51:22');
