(8840, 2220, 'a.	Risiko Suplai ( supply risk ) adalah Risiko permintaan merupakan potensi terjadinya variasi pada aliran outbound perusahaan yang dapat berpengaruh terhadap pesanaan customer seperti volume barang kirim , intensitas pengiriman dan lain sebagainya', 0, NULL, NULL),
