us menunda sekali lagi, atas permintaan Anda.</p><p><br></p><p class=\"ql-align-justify ql-indent-1\">H. Telepon berdering</p><p class=\"ql-align-justify ql-indent-1\"><br></p><p class=\"ql-align-justify\">Tindakan yang tidak mendesak dan sementara bisa Anda tunda adalah</p><p><br></p>', NULL, NULL, 131, NULL),
(82, '<p class=\"ql-align-justify\">Terdapat 3 faktor utama yang harus diperhatikan dalam melakukan presentasi yang efektif, yaitu</p>', NULL, NULL, 132, NULL),
(83, '<p>Dalam melakukan presentasi kemampuan apa yang harus dimiliki untuk bisa menarik kembali fokus audiens yang mulai tidak memperhatikan materi yang kita bawakan</p>', NULL, NULL, 132, NULL),
(84, '<p>1.&nbsp;&nbsp;Memilih topik yang dikuasai, menentukan tujuan presentasi dan mengenali audiens</p><p>2.&nbsp;&nbsp;Melakukan latihan berbicara didepan cermin</p><p>3.&nbsp;&nbsp;Mengalihkan perhatian dengan melakukan aktivitas, seperti berdo’a, minum, mengatur napas, mendengarkan music, berbicara dengan teman dan melihat pemandangan</p><p>4.&nbsp;&nbsp;Memastikan laptop/ tablet sebagai media presentasi berfungsi dengan baik</p><p>5.&nbsp;&nbsp;Mencari data audiens yang hadir</p><p>Berdasarkan uraian di atas, manakah yang termasuk cara mengatasi rasa cemas ketika akan melakukan sebuah presentasi ?</p>', NULL, NULL, 132, NULL),
(85, '<p class=\"ql-align-justify\">Dalam melayani customer, diperlukan pelayanan yang prima dari seorang customer service. Yang bukan merupakan unsur pelayanan prima adalah</p>', NULL, NULL, 133, NULL),
(86, '<p>Berikut ini merupakan langkah dalam menghasilkan pelayanan prima, kecuali</p>', NULL, NULL, 133, NULL),
(87, '<p class=\"ql-align-justify\">Anda adalah seorang cabin crew manager sebuah maskapai penerbangan internasional. Tanggungjawab Anda mencakup:</p><p class=\"ql-align-justify\">·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Mengelola sekelompok cabin crew, termasuk penilaian dan menangani pekerjaan dan masalah pribadi</p><p class=\"ql-align-justify\">·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Merekrut crew</p><p class=\"ql-align-justify\">·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Mengatur crew untuk acara-acara PR</p><p class=\"ql-align-justify\">·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Bekerja dalam sebuah tim proyek untuk membuat rekomendasi meningkatkan sistem penjadwalan. Bagian penjadwalan beroperasi 24 jam dalam sehari</p><p class=\"ql-align-justify\">Hari ini tanggal 18 Mei dan waktu menunjukkan puku 12.15 (GMT). Secara tidak direncanakan Anda diminta untuk melakukan perjalanan rekrutmen ke luar negeri selama lima hari dikarenakan ada rekan kerja yang tiba-tiba sakit. Tidak ada anggota tim lain yang bisa. Rekrutmen memakan waktu yang panjang, bahkan sering lebih dari dua belas jam kerja yang penuh konsentrasi.</p><p class=\"ql-align-justify\">Anda memiliki waktu 45 menit sebelum pergi ke bandara.</p><p class=\"ql-align-justify\">Anda memiliki telepon genggam yang dapat digunakan di negara manapun tapi tidak ada laptop. Untuk alasan keamanan, staf tidak diperkenankan untuk mengakses email kantor&nbsp;di lokasi tidak aman (seperti internet café). Penerbangan yang Anda gunakan tidak menyediakan sistem telepon di pesawat dan yang umum seperti penerbangan lainnya tidak diperkenankan menggunakan telepon genggam di pesawat. Waktu penerbangan ke tujuan adalah lima jam.</p><p class=\"ql-align-justify\">Karena pengurangan dalam keuangan, Anda tidak memiliki seorang sekretaris yang bekerja untuk Anda.</p><p class=\"ql-align-justify\">A.&nbsp;&nbsp;&nbsp;&nbsp;Pesan: “Bagian Pengaduan Pelanggan menelepon. Seorang Commercially Important Passenger (CIP) merah. Ia mengeluhkan tentang kekasaran salah satu crew Anda. Mereka ingin Anda menyelidikinya, mencari tahu cerita dari sisi crew dan menyampaikannya kembali kepada mereka pukul 13.00. mereka menjanjikan kepada CIP akan memberikan respon pada pukul 13.30. Crew tersebut baru tiba di rumah pagi ini setelah perjalanan semalaman.”</p><p class=\"ql-align-justify\">B.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Pesan dari Bagian PR: “Konferensi pers dimana Anda menunjuk dua orang crew untuk menghadirinya dipindah ke tanggal 23. Kedua crew yang Anda tunjuk tersebut tidak bisa. Membutuhkan dua crew pengganti yang sesuai”.</p><p class=\"ql-align-justify\">C.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Pesan: “ Telepon X (crew senior) di hotel singgah crew di Hongkong”</p><p class=\"ql-align-justify\">D.&nbsp;&nbsp;&nbsp;&nbsp;Email dari station Manager Hongkong: “Salah satu crew ditahan polisi. Saya sedang berhubungan dengan mereka sekarang”</p><p class=\"ql-align-justify\">E.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Pesan: “Seorang crew baru menelepon. Ia putus asa. Ia beradu argument dengan crew senior dan mengancam mengundurkan diri kecuali sesuatu dilakukan”</p><p class=\"ql-align-justify\">F.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Pesan: “ Seorang crew menginginkan Anda menyelesaikan sebuah masalah. Ia dianggap absen padahal ia mengaku telah menelepon waktu sakit”.</p><p class=\"ql-align-justify\">G.&nbsp;&nbsp;&nbsp;&nbsp;Email dari Rostering Project Team Leader: “Saya pikir gagasan Anda sangat bagus. Kami ingin berbicara dengan Anda mengenai bagaimana memasukkan gagasan tersebut ke dalam presentasi untuk manajemen senior tanggal 22. Sayangnya jika saya tidak dapat memperoleh informasi tambahan lagi maka kami akan presentasi dengan rekomendasi awal.”</p><p class=\"ql-align-justify\">H.&nbsp;&nbsp;&nbsp;&nbsp;Email dari rekan kerja: “ Seperti yang Anda tahu, Don akan pensiun setelah bertahun-tahun di maskapai ini. Tolong atur untuk merekam video anekdot yang akan kami kumpulkan untuknya paling lambat tanggal 23. Terima kasih”. Don merupakan teman dekat dan mentor Anda selama bertahun-tahun.</p><p class=\"ql-align-justify\">I.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Crew menunggu di luar ruangan Anda untuk pemeriksaan tahunan, dijadwalkan pukul 11.45. Anda telat</p><p class=\"ql-align-justify\">J.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Crew menunggu di luar ruangan Anda untuk pemeriksaan tahunan, dijadwalkan pukul 12.55.</p><p class=\"ql-align-justify\">K.&nbsp;&nbsp;&nbsp;&nbsp;Catatan perjanjian. Rapat dengan perancang grafis dan percetakan untuk melakukan finalisasi tata letak brosur rekrutmen yang baru. Harus disetujui hari ini jika batas waktu percetakan ingin dipenuhi. Brosur tersebut menonjolkan rekrutmen yang high-profile dan akan diluncurkan minggu depan. Jika batas waktu percetakan tidak dipenuhi maka brosur tidak akan siap untuk acara peluncuran.</p><p class=\"ql-align-justify\">L.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Catatan perjanjian untuk tanggal 19 dan 20; meninjau tiga crew sehari.</p><p class=\"ql-align-justify\">Pesan telepon: “Tolong temui saya, mendesak”. Dari section Head</p><p class=\"ql-align-justify\"><br></p><p class=\"ql-align-justify\"><br></p><p class=\"ql-align-justify\">Dari uraian diatas. Menurut Anda mana saja tindakan yang bisa Anda tunda dan bukan merupakan sesuatu yang mendesak ?&nbsp;</p>', NULL, NULL, 133, NULL),
(88, '<p class=\"ql-align-justify\">Anda adalah seorang cabin crew manager sebuah maskapai penerbangan internasional. Tanggungjawab Anda mencakup:</p><p class=\"ql-align-justify\">·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Mengelola sekelompok cabin crew, termasuk penilaian dan menangani pekerjaan dan masalah pribadi</p><p class=\"ql-align-justify\">·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Merekrut crew</p><p class=\"ql-align-justify\">·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Mengatur crew untuk acara-acara PR</p><p class=\"ql-align-justify\">·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Bekerja dalam sebuah tim proyek untuk membuat rekomendasi meningkatkan sistem penjadwalan. Bagian penjadwalan beroperasi 24 jam dalam sehari</p><p class=\"ql-align-justify\">Hari ini tanggal 18 Mei dan waktu menunjukkan puku 12.15 (GMT). Secara tidak direncanakan Anda diminta untuk melakukan perjalanan rekrutmen ke luar negeri selama lima hari dikarenakan ada rekan kerja yang tiba-tiba sakit. Tidak ada anggota tim lain yang bisa. Rekrutmen memakan waktu yang panjang, bahkan sering lebih dari dua belas jam kerja yang penuh konsentrasi.</p><p class=\"ql-align-justify\">Anda memiliki waktu 45 menit sebelum pergi ke bandara.</p><p class=\"ql-align-justify\">Anda memiliki telepon genggam yang dapat digunakan di negara manapun tapi tidak ada laptop. Untuk alasan keamanan, staf tidak diperkenankan untuk mengakses email kantor&nbsp;di lokasi tidak aman (seperti internet café). Penerbangan yang Anda gunakan tidak menyediakan sistem telepon di pesawat dan yang umum seperti penerbangan lainnya tidak diperkenankan menggunakan telepon genggam di pesawat. Waktu penerbangan ke tujuan adalah lima jam.</p><p class=\"ql-align-justify\">Karena pengurangan dalam keuangan, Anda tidak memiliki seorang sekretaris yang bekerja untuk Anda.</p><p class=\"ql-align-justify\">A.&nbsp;&nbsp;&nbsp;&nbsp;Pesan: “Bagian Pengaduan Pelanggan menelepon. Seorang Commercially Important Passenger (CIP) merah. Ia mengeluhkan tentang kekasaran salah satu crew Anda. Mereka ingin Anda menyelidikinya, mencari tahu cerita dari sisi crew dan menyampaikannya kembali kepada mereka pukul 13.00. mereka menjanjikan kepada CIP akan memberikan respon pada pukul 13.30. Crew tersebut baru tiba di rumah pagi ini setelah perjalanan semalaman.”</p><p class=\"ql-align-justify\">B.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Pesan dari Bagian PR: “Konferensi pers dimana Anda menunjuk dua orang crew untuk menghadirinya dipindah ke tanggal 23. Kedua crew yang Anda tunjuk tersebut tidak bisa. Membutuhkan dua crew pengganti yang sesuai”.</p><p class=\"ql-align-justify\">C.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Pesan: “ Telepon X (crew senior) di hotel singgah crew di Hongkong”</p><p class=\"ql-align-justify\">D.&nbsp;&nbsp;&nbsp;&nbsp;Email dari station Manager Hongkong: “Salah satu crew ditahan polisi. Saya sedang berhubungan dengan mereka sekarang”</p><p class=\"ql-align-justify\">E.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Pesan: “Seorang crew baru menelepon. Ia putus asa. Ia beradu argument dengan crew senior dan mengancam mengundurkan diri kecuali sesuatu dilakukan”</p><p class=\"ql-align-justify\">F.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Pesan: “ Seorang crew menginginkan Anda menyelesaikan sebuah masalah. Ia dianggap absen padahal ia mengaku telah menelepon waktu sakit”.</p><p class=\"ql-align-justify\">G.&nbsp;&nbsp;&nbsp;&nbsp;Email dari Rostering Project Team Leader: “Saya pikir gagasan Anda sangat bagus. Kami ingin berbicara dengan Anda mengenai bagaimana memasukkan gagasan tersebut ke dalam presentasi untuk manajemen senior tanggal 22. Sayangnya jika saya tidak dapat memperoleh informasi tambahan lagi maka kami akan presentasi dengan rekomendasi awal.”</p><p class=\"ql-align-justify\">H.&nbsp;&nbsp;&nbsp;&nbsp;Email dari rekan kerja: “ Seperti yang Anda tahu, Don akan pensiun setelah bertahun-tahun di maskapai ini. Tolong atur untuk merekam video anekdot yang akan kami kumpulkan untuknya paling lambat tanggal 23. Terima kasih”. Don merupakan teman dekat dan mentor Anda selama bertahun-tahun.</p><p class=\"ql-align-justify\">I.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Crew menunggu di luar ruangan Anda untuk pemeriksaan tahunan, dijadwalkan pukul 11.45. Anda telat</p><p class=\"ql-align-justify\">J.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Crew menunggu di luar ruangan Anda untuk pemeriksaan tahunan, dijadwalkan pukul 12.55.</p><p class=\"ql-align-justify\">K.&nbsp;&nbsp;&nbsp;&nbsp;Catatan perjanjian. Rapat dengan perancang grafis dan percetakan untuk melakukan finalisasi tata letak brosur rekrutmen yang baru. Harus disetujui hari ini jika batas waktu percetakan ingin dipenuhi. Brosur tersebut menonjolkan rekrutmen yang high-profile dan akan diluncurkan minggu depan. Jika batas waktu percetakan tidak dipenuhi maka brosur tidak akan siap untuk acara peluncuran.</p><p class=\"ql-align-justify\">L.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Catatan perjanjian untuk tanggal 19 dan 20; meninjau tiga crew sehari.</p><p class=\"ql-align-justify\">Pesan telepon: “Tolong temui saya, mendesak”. Dari section Head</p><p><br></p><p><br></p><p>Tindakan yang menjadi prioritas untuk segera diselesaikan adalah</p>', NULL, NULL, 133, NULL),
