(129, '<p class=\"ql-align-justify\">Anda bekerja di sebuah Hotel bintang 5 di Bali. Saat ini menunjukkan pukul 15.00 WITA dan Anda sedang melakukan FGD bersama atasan serta rekan Anda dalam satu tim. Pembahasan sore ini adalah mengenai penurunan omset perusahaan yang diakibatkan rendahnya tingkat penjualan kamar. Hal ini diakibatkan lonjakan angka positif covid 19 yang menyebabkan mayarakat menunda untuk melakukan perjalanan atau liburan. Atasan Anda ingin mendengarkan pendapat timnya untuk mencari jalan keluar menghadapi permasalahan tersebut. Apa pendapat yang sebaiknya tidak Anda ungkapkan ?&nbsp;</p><p><br></p>', NULL, NULL, 147, NULL),
