(139, '<p class=\"ql-align-justify\">Terjadi turn over yang sangat tinggi di suatu perusahaan. Bahkan dalam satu bulan bisa 5 banding 5 antara karyawan masuk dan karyawan keluar, terutama dibagian produksi. Setelah dilihat dari kuesioner exit interview yang mereka isi, rata-rata alasan keluar mereka adalah hubungan dengan atasan. Jika dilihat ke lapangan, sikap manajer produksi nya sendiri sangat tidak perduli dengan bawahan, sehingga berdampak pada turn over karyawan dan berdampak pula pada manajemen terutama bagian HRD, untuk selalu menyiapkan karyawan baru sebagai penggantinya.</p><p>Dari contoh tersebut bisa dilihat, kemampuan apa yang sekiranya perlu diperbaiki dalam diri Manager tersebut ?</p>', NULL, NULL, 152, NULL),
