(1265, '<p class=\"ql-align-justify\">Sekarang pukul 14.00. Anda baru saja makan siang dengan beberapa orang relasi. Sekembalinya ke kantor, hal-hal berikut menanti Anda untuk diurus. Anda memiliki tim yang terdiri dari dua asisten. Satu orang sedang liburan sedangkan yang satu lagi saat ini sedang tidak berada ditempat:</p><p class=\"ql-align-justify\">A.&nbsp;&nbsp;&nbsp;&nbsp;Pesan dari CEO: “Tolong telepon saya secepatnya”</p><p class=\"ql-align-justify\">B.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Pesan tertulis: “Tuan Y (klien komersial penting) mencoba untuk menghubungi Anda -&nbsp;tolong untuk menelepon balik”</p><p class=\"ql-align-justify\">C.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Catatan perjanjian: Rapat rutin Bagian pukul 14.30</p><p class=\"ql-align-justify\">D.&nbsp;&nbsp;&nbsp;&nbsp;Catatan perjanjian: Wawancara pelamar X dan Y untuk jabatan baru pukul 15.30 dan 16.15 secara berturut-turut</p><p class=\"ql-align-justify\">E.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Email silang</p><p class=\"ql-align-justify\">F.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Pesan dari SDM: “Dapatkah kita mengadakan rapat pendahuluan sebelum wawancara siang ini ? Mohon menelepon untuk mengatur waktunya. Pesan pukul 13.00”. (Anda menyadari belum mempersiapkan diri untuk wawancara tersebut)</p><p class=\"ql-align-justify\">G.&nbsp;&nbsp;&nbsp;&nbsp;Pesan dari Finance: “Mohon mengisi kuesioner yang kami kirimkan minggu lallu. Kami harus memiliki informasi tersebut pukul 16.00 jika tidak permintaan tambahan Anda akan ditolak</p><p class=\"ql-align-justify\">H.&nbsp;&nbsp;&nbsp;&nbsp;Telepon berdering</p><p class=\"ql-align-justify\">&nbsp;</p><p class=\"ql-align-justify\">Berikut ini tindakan yang paling menjadi prioritas bagi Anda untuk segera dilakukan tindakan adalah</p>', NULL, NULL, 272, NULL),
(1266, '<p class=\"ql-align-justify\">Sekarang pukul 14.00. Anda baru saja makan siang dengan beberapa orang relasi. Sekembalinya ke kantor, hal-hal berikut menanti Anda untuk diurus. Anda memiliki tim yang terdiri dari dua asisten. Satu orang sedang liburan sedangkan yang satu lagi saat ini sedang tidak berada ditempat:</p><p class=\"ql-align-justify\">A.&nbsp;&nbsp;&nbsp;&nbsp;Pesan dari CEO: “Tolong telepon saya secepatnya”</p><p class=\"ql-align-justify\">B.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Pesan tertulis: “Tuan Y (klien komersial penting) mencoba untuk menghubungi Anda -&nbsp;tolong untuk menelepon balik”</p><p class=\"ql-align-justify\">C.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Catatan perjanjian: Rapat rutin Bagian pukul 14.30</p><p class=\"ql-align-justify\">D.&nbsp;&nbsp;&nbsp;&nbsp;Catatan perjanjian: Wawancara pelamar X dan Y untuk jabatan baru pukul 15.30 dan 16.15 secara berturut-turut</p><p class=\"ql-align-justify\">E.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Email silang</p><p class=\"ql-align-justify\">F.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Pesan dari SDM: “Dapatkah kita mengadakan rapat pendahuluan sebelum wawancara siang ini ? Mohon menelepon untuk mengatur waktunya. Pesan pukul 13.00”. (Anda menyadari belum mempersiapkan diri untuk wawancara tersebut)</p><p class=\"ql-align-justify\">G.&nbsp;&nbsp;&nbsp;&nbsp;Pesan dari Finance: “Mohon mengisi kuesioner yang kami kirimkan minggu lallu. Kami harus memiliki informasi tersebut pukul 16.00 jika tidak permintaan tambahan Anda akan ditolak</p><p class=\"ql-align-justify\">H.&nbsp;&nbsp;&nbsp;&nbsp;Telepon berdering</p><p class=\"ql-align-justify\"><br></p><p class=\"ql-align-justify\">Berikut <span style=\"color: black;\">ini tindakan yang bisa anda pilih untuk menghilangkan ketidakpastian adalah</span></p>', NULL, NULL, 272, NULL),
