(1656, '<p>Berikut ini adalah sikap yang tidak boleh dimiliki oleh seorang leader, yaitu</p>', NULL, NULL, 361, NULL),
(1657, '<p class=\"ql-align-justify\">Anda bekerja sebagai Kepala Cabang di perusahaan otomotif. Anda baru menerima promosi jabatan tersebut selama 6 bulan, namun karena adanya pandemi, penjualan cabang anda 3 bulan terakhir mengalami penurunan yang drastis. Anda tidak mampu memenuhi target yang diberikan oleh kantor pusat. Anda harus bisa mempertanggungjawabkan pencapaian tersebut dan menyampaikannya kepada atasan Anda.</p><p class=\"ql-align-justify\">Tim sales Anda pun mulai mengalami demotivasi karena merasakan sulitnya kondisi yang dihadapi untuk mencari customer baru. Hal tersebut sangat berpengaruh terhadap pergerakan mereka untuk turun ke lapangan, sehingga kinerjanya mulai menurun. </p><p class=\"ql-align-justify\">Dilain sisi Anda mendapatkan surat peringatan yang menyebutkan bahwa kantor cabang tempat Anda bekerja akan ditutup dalam 3 bulan kedepan jika penjualan yang dilakukan tidak mampu menutup biaya operasional yang dikeluarkan.</p><p class=\"ql-align-justify\">Anda dihadapkan kepada berbagai situasi. Sebagai leader apa yang akan Anda lakukan pertama kali untuk menghadapi situasi tersebut ?</p><p><br></p>', NULL, NULL, 361, NULL),
