INSERT INTO `test_questions` (`id`, `description`, `created_at`, `updated_at`, `course_id`, `is_pre_test`) VALUES
(2169, '<p>Berdasarkan informasi kualitas melalui LKH dan klaim yang diterima oleh AHM terkait kasus pada Pump Unit Fuel, dengan gejala konsumen mengeluhkan ketika sedang mengendarai sepeda motornya pada saat akselerasi terasa brebet atau motor tiba-tiba mati dan terkadang motor sulit dihidupkan kembali. Setelah dianalisa lebih lanjut oleh mekanik ternyata terdapat abnormality/ketidaknormalan pada Pump Unit Fuel. Namun ketika dilakukan analisis di AHM ternyata kondisi part klaim tidak bermasalah (Part OK). sebagai panduan tahapan-tahapan dalam melakukan analisa masalah dan berdampingan dengan Buku Pedoman Reparasi yang telah diterbitkan oleh PT. Astra Honda Motor. Sehingga muncul Acuan untuk digunakan dalam melakukan analisa dan pengecekan Unit Fuel Pump&nbsp;sehingga diterbikan ITI&nbsp;no =</p>', NULL, NULL, 452, NULL),
(2170, '<p>Saat ini, kemasan oli mesin AHM oil yang tersedia di pasaran berkapasitas 800mL, 1000mL sampai 1200mL. Begitu juga untuk tipe sepeda motor Honda kapasitas oli mesinnya pun bervariasi. Sebagai contoh untuk tipe sepeda motor Honda mesin generasi baru 110cc berpendingin udara yang disematkan saat ini pada Genio, Beat Series (2020), &amp; Scoopy (2020), kapasitas volume penggantian oli mesin secara periodik adalah di 650mL, artinya dengan kemasan oli 800mL harus ada sisa oli yang tidak boleh dimasukkan ke dalam mesin. Faktanya saat dilakukan pengisian oli pada tipe sepeda motor Honda Genio, Beat Series (2020), &amp; Scoopy (2020), mekanik tidak menggunakan gelas ukur, sehingga menyebabkan pengisian oli yang berlebih. Maka melalui ITI ini diharapkan dapat pengingat agar lebih teliti saat melakukan aktivitas penggantian oli sesuai dengan kapasitas volume nya. Berapakah no ITI yang merujuk sebagai acuan dalam pengantian oli mesin di Ahass ?</p>', NULL, NULL, 452, NULL),
(2171, '<p>Berapa<strong> </strong>Kode Gejala/Symptom Code pada &nbsp;komponen Part Pad Set FR Brake berdasarkan&nbsp;&nbsp;Nomor ITI AHM-ITI-2022-0004&nbsp;</p>', NULL, NULL, 452, NULL),
(2172, '<p>Saat menghidupkan SMH miliknya, konsumen mendengar suara tidak normal pada area mesin sebelah kiri , suara tidak normal ini terengar saat kondisi idle dan akselerasi . Tindakan yang harus dilakukan AHASS Jika menemukan kasus serupa : </p><p>1. Periksa kondisi Piece Slide, jika ditemukan Piece Slide bergesekan dengan Face Comp Movable sehingga TERGERUS dan DIMENSI NG maka silakan diajukan proses claim sesuai aturan claim yang berlaku.</p><p>&nbsp;2. Pada unit pembelian setelah bulan perbaikan, harap segera mengirim LKH dan wajib melaporkan ke Main Dealer.</p><p>&nbsp;Claim : Jenis Claim : Regular warranty Main Part : 22011-K1NV01 (PIECE SET, SLIDE) 22110K2SN00 - FACE COMP, MOVABLE DRIVE</p><p><strong>Berapakah No SNI ( Service Network&nbsp;Information ) yang telah menjelaskan&nbsp;prosedur penanganan proses Claim&nbsp;sesuai arahan dari AHM yang benar dan tepat ?</strong></p>', NULL, NULL, 452, NULL),
(2173, '<p><span style=\"background-color: whitesmoke; color: rgb(51, 51, 51);\">AHM-ITI-2022-0008&nbsp;&nbsp;&nbsp;&nbsp;Nomor ITI tersebut menjelaskan tentang&nbsp;</span></p>', NULL, NULL, 453, NULL),
