(2221, '<p>Dalam manajemen risiko , terdapat beberapa standart yang dapat diterapkan , dimana pemilihan terhadap standart yang digunakan disesuaikan dengan kebutuhan dan tujuan perusahaan . Berikut beberapa standart manajemen risiko yang menurut standart dan kategorinya yang paling benar adalah</p>', NULL, NULL, 463, NULL),
(2225, '<p>Berikut adalah langkah start compresor.</p><p><br></p><p><strong style=\"color: rgb(255, 255, 255); background-color: rgb(230, 0, 0);\">1</strong></p><p><span style=\"color: black;\">Pastikan Syarat Penyalaan Kompresor sudah Terpenuhi</span></p><p>•<span style=\"color: black;\">Cooling tower ON</span></p><p>•<span style=\"color: black;\">Kondensor ON</span></p><p><br></p><p><strong style=\"color: rgb(255, 255, 255); background-color: rgb(230, 0, 0);\">2</strong></p><p>•<span style=\"color: black;\">Tekan saklar Load atas pada panel bawah</span></p><p>•<span style=\"color: black;\">Buka valve suction penuh</span></p><p>•<span style=\"color: black;\">Kencangkan loading capacity (oli)</span></p><p>•<span style=\"color: black;\">Tekan saklar load bawah pada panel bawah</span></p><p><br></p><p><span style=\"color: rgb(255, 255, 255); background-color: rgb(230, 0, 0);\">3</span></p><p>•<span style=\"color: black;\">Saat Compressor sudah Running pastikan cooling compressor bekerja dengan baik,</span></p><p><span style=\"color: black;\">dengan cara sering melakukan pengecekan pada selang” compressor.&nbsp;</span></p><p><br></p><p><strong style=\"color: rgb(255, 255, 255); background-color: rgb(230, 0, 0);\">4</strong></p><p>•<span style=\"color: black;\">Valve Discharge Harus dalam keadaan terbuka</span></p><p>•<span style=\"color: black;\">Buka Valve Suction sedikit</span></p><p>•<span style=\"color: black;\">Tekan Push Button ON pada panel Compressor</span></p><p><br></p><p><br></p><p>Bagaimana uruttan langkah start compressor yang benar ?</p>', NULL, NULL, 467, NULL),
